5H/DlfXjnk5AonFS/kH/Kv/GNc4fgD9UcWof6CP8Bf4E+XSSfIJWFugr/hH/AvxQX882Bq+Df6QyIC/QX9Bf0J/Q39Df0N/Q39Ef11+7AOVkZ/tqJw9NZpnm30V1kE/RX9Ff31p+mv/wZwFI9AE1qPngAAAABJRU5ErkJggg==\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":2088,\"height\":724},\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"130bc576-4cfc-435d-85f2-279873a64d4c\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1. Name the different factors that produce rock deformations. </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"429ba806-b442-42bc-8b15-63620fbb9a51\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2. Compare the factors that produce normal faults to those that produce inverted faults. </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"dac39e54-c001-45e1-88d6-1a3695d665a1\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3. When do foliation occurs mainly? </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"511ca103-8e57-4923-b1a8-e07dcc29ce97\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>Which factors produce isopach folds? and anisopach folds? </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"b3441b45-1ca1-4666-977e-9001ce7e10b9\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4. Can you now summarise all your observations? </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"56a3e92e-b82e-4865-944c-8ad0043ad0f6\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Observe the table below and answer the following questions.\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Observe the table below and answer the following questions.\"},\"subContentId\":\"b4b71766-dc9e-4100-b947-999a5b99cf0e\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. Compression/extension forces, pressure, temperature. </p>\\n\\n<p>2. Faults occur at low temperature and pressure. Inverted faults are due to compression forces and normal faults are due to extension forces. </p>\\n\\n<p>3. Foliation occurs when the temperature and the pressure are high. Strong compression  is a contributing factor.</p>\\n\\n<p>4. Summary: </p>\\n\\n<p>Compression forces as well as temperature and pressure produce rock deformations. </p>\\n\\n<p>Faults occur when the pressure and the temperature are low, Compression forces produce inverted faults while extension forces produce normal faults. </p>\\n\\n<p>Folds occur when the pressure and the temperature are medium and compression forces are exerted. </p>\\n\\n<p>High pressure and temperature produce metamorphic rock foliations. Strong compression is a contributing factor. </p>\\n\\n<p> </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1537cebc-f3ab-47fe-9324-9ae32143f2b4\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Elements of response\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Elements of response\"},\"subContentId\":\"f65cf3d8-f4e9-42ed-a73c-4bb88a3515ce\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Metamorphic rocks\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Metamorphic rocks\"},\"subContentId\":\"6e99fa66-265c-4911-b7ab-82eb4fd7f5f8\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.12","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"I Solve Complex Problems","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.TextInputField-1.2/text-input-field.js?version=1.2.13","/h5p/libraries/H5P.TextInputField-1.2/xapi-generator.js?version=1.2.13","/h5p/libraries/H5P.Text-1.1/scripts/text.js?version=1.1.17","/h5p/libraries/H5P.StandardPage-1.5/standard-page.js?version=1.5.15","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.
